import { useState } from "react";
import axios from "axios";
import Grid from "@mui/material/Grid";
import TextField from "@mui/material/TextField";
import Button from "@mui/material/Button";
import Navbar from "../templates/Navbar";
import Vendor_Navbar from "../templates/Vendor_Navbar";
import { useNavigate, useLocation } from "react-router";
import "./common.css"


const AddFooditem = (props) => {
    const [name, setName] = useState("");
    const [price, setprice] = useState("");
    const [vendor_email, setEmail] = useState(useState(localStorage.getItem("email")));
    const [rating, setrating] = useState(" ");
    const [FoodDiscription, setdiscription] = useState(" ");
    const [add_ons, setaddon] = useState(" ");


    const onChangename = (event) => {
        setName(event.target.value);
    };
    const onChangeprice = (event) => {
        setprice(event.target.value);
    };

    // const onChangeEmail = (event) => {
    //     setEmail(event.target.value);
    // };
    const onChangeFoodDiscription = (event) => {
        setdiscription(event.target.value);
    };
    const onChangeAddons = (event) => {
        setaddon(event.target.value);
    };


    const resetInputs = () => {
        setName("");
        setprice("");
        setdiscription("");
        setaddon("");
    };

    const onSubmit = (event) => {
        event.preventDefault();

        const NUser = {
            MangerName: MangerName,
            CanteenName: CanteenName,
            email: email,
            contact: contact,
            opening : opening,
            closing : closing,
            Address: Address,
            password: password,
            date: Date.now(),
        };

        axios
            .post("http://localhost:4000/vendor/vendorregister", NUser)
            .then((response) => {
                alert("Created\t" + response.data.CanteenName);
                console.log(response.data);
            });

        resetInputs();
    };

    return (
        <div>
            <Vendor_Navbar />
            <h3 className="profile"> Adding Food Items to Canteen</h3>
            <div style={{ marginTop: 40 }}>
                <Grid container align={"center"} spacing={2}>
                    <Grid item xs={12}>
                        <TextField
                            label="Food Item Name"
                            variant="outlined"
                            value={name}
                            onChange={onChangename}
                        />
                    </Grid>
                    <Grid item xs={12}>
                        <TextField
                            label="price"
                            variant="outlined"
                            value={price}
                            onChange={onChangeprice}
                        />
                    </Grid>
                    <Grid item xs={12}>
                        <TextField
                            label="Veg or NonVeg"
                            variant="outlined"
                            value={FoodDiscription}
                            onChange={onChangeFoodDiscription}
                        />
                    </Grid>
                    <Grid item xs={12}>
                        <TextField
                            label="add on Details"
                            variant="outlined"
                            value={add_ons}
                            onChange={onChangeAddons}
                        />
                    </Grid>
                    <Grid item xs={12}>
                        <Button variant="contained" onClick={onSubmit}>
                            Save
                        </Button>
                    </Grid>
                </Grid>
            </div>
        </div>
    );
};

export default AddFooditem;
